#!/bin/bash

# This macro is used to generate the ROOT dictionaries
# To use the ctest launchers one needs some environment variables which
# are only present when running CMake. To have the same environment at
# the time the dictionary is build this script is used which is build
# at the time cmake runs.

# Setup the needed environment
export LD_LIBRARY_PATH=/opt/fairsoft/lib/root::/work/R3BRoot/build/lib:/opt/fairroot/lib:/opt/fairsoft/lib/root:/opt/fairsoft/lib
export DYLD_LIBRARY_PATH=/opt/fairsoft/lib/root::/work/R3BRoot/build/lib:/opt/fairroot/lib:/opt/fairsoft/lib/root:/opt/fairsoft/lib
export ROOTSYS=/opt/fairsoft

/opt/fairsoft/bin/rootcint -f /work/R3BRoot/build/r3bdata/G__R3BDataDict.cxx -rmf /work/R3BRoot/build/lib/libR3BData.rootmap -rml R3BData.so  -inlineInputHeader -c   -I/work/R3BRoot/r3bdata -I/work/R3BRoot/r3bdata/xballData -I/work/R3BRoot/r3bdata/califaData -I/work/R3BRoot/r3bdata/hpgeData -I/work/R3BRoot/r3bdata/wrData -I/work/R3BRoot/r3bdata/beammonitorData -I/work/R3BRoot/r3bdata/dhcData -I/work/R3BRoot/r3bdata/gfiData -I/work/R3BRoot/r3bdata/mtofData -I/work/R3BRoot/r3bdata/tofData -I/work/R3BRoot/r3bdata/pdcData -I/work/R3BRoot/r3bdata/vetoData -I/work/R3BRoot/r3bdata/lumonData -I/work/R3BRoot/r3bdata/trackerData -I/work/R3BRoot/r3bdata/startrackData -I/work/R3BRoot/r3bdata/landData -I/work/R3BRoot/r3bdata/roluData -I/work/R3BRoot/r3bdata/losData -I/work/R3BRoot/r3bdata/sci2Data -I/work/R3BRoot/r3bdata/sci8Data -I/work/R3BRoot/r3bdata/mfiData -I/work/R3BRoot/r3bdata/fibData -I/work/R3BRoot/r3bdata/pspData -I/work/R3BRoot/r3bdata/neulandData -I/work/R3BRoot/r3bdata/actarData -I/work/R3BRoot/r3bdata/strawtubesData -I/work/R3BRoot/r3bdata/amsData -I/work/R3BRoot/r3bdata/sci2Data -I/work/R3BRoot/r3bdata/sci8Data -I/work/R3BRoot/r3bdata/musicData -I/work/R3BRoot/r3bdata/sampData -I/work/R3BRoot/r3bdata/sfibData -I/work/R3BRoot/r3bdata/frsData -I/opt/fairsoft/include/root6 -I/opt/fairsoft/include -I/opt/fairroot/include R3BMCStack.h R3BMCTrack.h wrData/R3BWRMasterData.h wrData/R3BWRCalifaData.h wrData/R3BWRAmsData.h R3BHit.h R3BTrack.h R3BDouble.h xballData/R3BXBallPoint.h xballData/R3BXBallCrystalHit.h xballData/R3BXBallCrystalHitSim.h califaData/R3BCalifaCrystalCalData.h califaData/R3BCalifaMappedData.h califaData/R3BCalifaHitData.h califaData/R3BCalifaPoint.h hpgeData/R3BHPGeDetHit.h hpgeData/R3BHPGeDetPoint.h dchData/R3BDchPoint.h dchData/R3BDchFullPoint.h gfiData/R3BGfiPoint.h mtofData/R3BmTofPoint.h mtofData/R3BmTofDigi.h tofData/R3BTofPoint.h vetoData/R3BVetoPoint.h lumonData/ELILuMonPoint.h trackerData/R3BTraPoint.h trackerData/R3BTraHit.h trackerData/R3BSit